//******* Sound_Start ************
// This function does not output to the DAC. 
// Rather, it sets a pointer and counter, and then enables the timer interrupt.
// It starts the sound, and the timer ISR does the output
// feel free to change the parameters
// Input: pt is a pointer to an array of DAC outputs
//        count is the length of the array
// Output: none
// special cases: as you wish to implement
soundeffect sound2play; // global variable that tells which sound to play
typedef struct { 
   const unsigned char *wave; //a pointer to the sound samples array
   uint32_t length;     // how long the array is
} sound_t;
sound_t sounds[5] ={
	{LOZ_Sword_Slash, 2851},
	{LOZ_Bomb_Drop, 2232},
	{LOZ_Bomb_Blow, 5361},
	{Intro, 143677},
	//{Intropt2, 78225}
};
void Timer0A_Stop(void);
uint32_t pIndex=0;
void playsample(){
   DAC_Out(sounds[sound2play].wave[pIndex++]);
   if (pIndex >= sounds[sound2play].length){
     Timer0A_Stop();
		 NVIC_EN0_R = 1<<21;
     pIndex=0;
   }
}
extern void Timer0A_Init(void(*task)(void), uint32_t period);

void playsound(soundeffect sound){
  sound2play = sound;
	Timer0A_Init(*playsample, BusClock/SampleFreq); // 11.025 kHz
}
